type dfa_cache = subparser list Cache.t

type sll_subparser_closure_step_result =
| SllStepDone
| SllStepK of subparser list
| SllStepError of prediction_error
| SllStepFailover

(** val sllSpClosureStep :
    grammar -> subparser -> sll_subparser_closure_step_result **)

let sllSpClosureStep g sp =
  let { avail = av; prediction = pred; stack = stack1 } = sp
  in
  let (loc0, locs) = stack1 in
  let { lopt = _; rpre = _; rsuf = rsuf0 } = loc0 in
  (match rsuf0 with
   | [] ->
     (match locs with
      | [] -> SllStepFailover
      | l :: locs_tl ->
        let { lopt = xo_cr; rpre = pre_cr; rsuf = rsuf1 } = l
        in
        (match rsuf1 with
         | [] -> SllStepError SpInvalidState
         | s :: suf_cr ->
           (match s with
            | T _ -> SllStepError SpInvalidState
            | NT x ->
              let stk' = ({ lopt = xo_cr; rpre =
                (app pre_cr ((NT x) :: [])); rsuf = suf_cr },
                locs_tl)
              in
              SllStepK ({ avail = (NtSet.add x av);
              prediction = pred; stack = stk' } :: []))))
   | s :: _ ->
     (match s with
      | T _ -> SllStepDone
      | NT x ->
        if NtSet.mem x av
        then let sps' =
               map (fun rhs -> { avail = (NtSet.remove x av);
                 prediction = pred; stack = ({ lopt = (Some
                 x); rpre = []; rsuf = rhs },
                 (loc0 :: locs)) }) (rhssForNt g x)
             in
             SllStepK sps'
        else if NtSet.mem x (allNts g)
             then SllStepError (SpLeftRecursion x)
             else SllStepK []))

type sll_closure_result =
| Sllc_error of prediction_error
| Sllc_failover
| Sllc_succ of subparser list

(** val aggrSllClosureResults :
    sll_closure_result list -> sll_closure_result **)

let rec aggrSllClosureResults = function
| [] -> Sllc_succ []
| cr :: crs' ->
  let s0 = aggrSllClosureResults crs' in
  (match cr with
   | Sllc_error e -> Sllc_error e
   | Sllc_failover ->
     (match s0 with
      | Sllc_error e -> Sllc_error e
      | _ -> Sllc_failover)
   | Sllc_succ sps ->
     (match s0 with
      | Sllc_succ sps' -> Sllc_succ (app sps sps')
      | x -> x))

(** val sllSpClosure :
    grammar -> subparser -> sll_closure_result **)

let rec sllSpClosure g sp =
  match sllSpClosureStep g sp with
  | SllStepDone -> Sllc_succ (sp :: [])
  | SllStepK sps' ->
    let crs = dmap sps' (fun sp' _ -> sllSpClosure g sp') in
    aggrSllClosureResults crs
  | SllStepError e -> Sllc_error e
  | SllStepFailover -> Sllc_failover

(** val sll_closure :
    grammar -> subparser list -> sll_closure_result **)

let sll_closure g sps =
  aggrSllClosureResults
    (map (fun sp -> sllSpClosure g sp) sps)

type sll_result =
| Sll_failover
| Sll_normal of dfa_cache * prediction_result

(** val dfa_state_of : subparser list -> dfa_state **)

let dfa_state_of sps =
  map (fun sp -> (sp.prediction, sp.stack)) sps

(** val sllPredict' :
    grammar -> subparser list -> token list -> dfa_cache ->
    sll_result **)

let rec sllPredict' g sps ts c =
  match sps with
  | [] -> Sll_normal (c, PredReject)
  | sp :: sps' ->
    if allPredictionsEqual sp sps'
    then Sll_normal (c, (PredSucc sp.prediction))
    else (match ts with
          | [] -> Sll_normal (c, (handleFinalSubparsers sps))
          | t0 :: ts' ->
            let (a, l) = t0 in
            let k = ((dfa_state_of sps), a) in
            (match Cache.find k c with
             | Some sps'0 -> sllPredict' g sps'0 ts' c
             | None ->
               (match move g (a, l) sps with
                | Inl msg -> Sll_normal (c, (PredError msg))
                | Inr mv ->
                  (match sll_closure g mv with
                   | Sllc_error e ->
                     Sll_normal (c, (PredError e))
                   | Sllc_failover -> Sll_failover
                   | Sllc_succ cl ->
                     let c' = Cache.add k cl c in
                     sllPredict' g cl ts' c'))))

(** val sllInitSps :
    grammar -> nonterminal -> subparser list **)

let sllInitSps g x =
  map (fun rhs -> { avail = (allNts g); prediction = rhs;
    stack = ({ lopt = (Some x); rpre = []; rsuf = rhs },
    []) }) (rhssForNt g x)

(** val sllStartState :
    grammar -> nonterminal -> sll_closure_result **)

let sllStartState g x =
  sll_closure g (sllInitSps g x)

(** val sllPredict :
    grammar -> nonterminal -> token list -> dfa_cache ->
    sll_result **)

let sllPredict g x ts c =
  match sllStartState g x with
  | Sllc_error e -> Sll_normal (c, (PredError e))
  | Sllc_failover -> Sll_failover
  | Sllc_succ sps -> sllPredict' g sps ts c

(** val predict :
    grammar -> nonterminal -> location_stack0 -> token list
    -> dfa_cache -> dfa_cache * prediction_result **)

let failover_counter : int ref = ref 0
let normal_counter : int ref = ref 0

let rec int_of_nat n =
  match n with
  | O -> 0
  | S n' -> 1 + int_of_nat n'
                                   
let predict g x stk ts c =
  match sllPredict g x ts c with
  | Sll_failover ->
     let () = print_int !failover_counter in
     let () = print_string ": failing over\n" in
     let () = print_string "nonterminal: " in
     let () = print_int (int_of_nat x) in
     let () = print_string "\n\n" in
     let () = failover_counter := !failover_counter + 1 in
     (c, (llPredict g x stk ts))
  | Sll_normal (c', r) ->
     let () = print_int !normal_counter in
     let () = print_string ": SLL success\n\n" in
     let () = normal_counter := !normal_counter + 1 in
     (c', r)

